import React, { Component } from 'react';
import { connect } from 'react-redux';
import mapStoreToProps from '../redux/mapStoreToProps';
import Components from '../components/.list.js';
import Functions from '../functions/.list.js';

class AoG extends Component {
  render() {
    let display = '';
    if (!this.props.store.displayReducer)
      this.props.store.displayReducer.forEach((item) => {
        console.log(item);
        display += `${item} `;
      });

    // console.log(display);
    return (
      <div className="page">
        <div className="gWin">
          <Functions.EVL />
          <div className={display}>
            <Components.MainMenu />
            <script src="../functions/EVL.js" />
          </div>
        </div>
      </div>
    );
  }
}

export default connect(mapStoreToProps)(AoG);
